import React from 'react';
import classes from "./MyPosts.module.css";
import Post from './Post/Post';

let posts = [
  { message: "Congratulation!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
  { message: "YOU'VE DONE IT!", like: "999999999999999999999999999999999999999999999999999999999999999999999999999999999999" },
]
let PostElement = posts.map(post => <Post message={post.message} like={post.like} />)
const MyPosts = () => {
  return (
    <div className={classes.MyPosts}>
      <h2>My posts</h2>
      <div>
        <div>
          <textarea></textarea>
        </div>
        <div>
          <button>Add post</button>
        </div>
        New post
      </div>
      <div className={classes.posts}>
        {PostElement}
      </div>
    </div>
  );
}

export default MyPosts;
